termsFooter_howItWorks_text:
Datoteke povlecite in spustite v določeno območje ali jih izberite na običajen način; datoteke bodo šifrirane in poslane v strežnik. Prejeli boste dve povezavi do datoteke:
povezavo za prenos, ki jo lahko delite z drugimi;
in povezavo za brisanje, s katero lahko datoteko kadar koli izbrišete.
